b\u0438 \u043d\u0430 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u043c \u0448\u0430\u0440\u0435 \u0441 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%B1%D0%BB%D0%B8%D0%BD\" title=\"\u0414\u0443\u0431\u043b\u0438\u043d\">\u0414\u0443\u0431\u043b\u0438\u043d\u0435<\/a>, (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f<\/a>), \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b\u0438 \u0434\u0432\u0443\u0445\u0447\u0430\u0441\u043e\u0432\u043e\u0439 \u043f\u043e\u043b\u0451\u0442 \u0438 \u043f\u0440\u0438\u0437\u0435\u043c\u043b\u0438\u043b\u0438\u0441\u044c \u0432 \u0420\u044d\u0442\u043e\u0443\u0442\u0435. \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u043e\u043b\u0451\u0442\u0430 \u043c\u0430\u043b\u044c\u0447\u0438\u043a \u043e\u043a\u043e\u043b\u043e \u0447\u0430\u0441\u0430 \u0432\u044b\u0431\u0438\u0432\u0430\u043b \u043d\u0430 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u0435 \u0434\u0440\u043e\u0431\u044c, \u0447\u0442\u043e\u0431\u044b \u0443\u043a\u0430\u0437\u0430\u0442\u044c \u043c\u0435\u0441\u0442\u043e\u043d\u0430\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u0430 \u0441\u043e\u0431\u0440\u0430\u0432\u0448\u0435\u0439\u0441\u044f \u0442\u043e\u043b\u043f\u0435 \u0437\u0440\u0438\u0442\u0435\u043b\u0435\u0439. \u042d\u0442\u043e \u0431\u044b\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u043c \u0448\u0430\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 \u041f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u044b<\/a> \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1801_%D0%B3%D0%BE%D0%B4\" title=\"1801 \u0433\u043e\u0434\">1801<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84\" title=\"\u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444\">\u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444\u0441\u043a\u043e\u0439<\/a> \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0435 \u043f\u0443\u0441\u043a\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0446\u0435\u0445 \u043a\u0430\u0437\u0451\u043d\u043d\u043e\u0433\u043e \u0447\u0443\u0433\u0443\u043d\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430 (\u0442\u0435\u043f\u0435\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u0437\u0430\u0432\u043e\u0434\">\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u0437\u0430\u0432\u043e\u0434<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 \u0422\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0441\u0432\u044f\u0449\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%91%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86\" title=\"\u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u041a\u0440\u0435\u043c\u043b\u0451\u0432\u0441\u043a\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446\">\u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u041a\u0440\u0435\u043c\u043b\u0451\u0432\u0441\u043a\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856_%D0%B3%D0%BE%D0%B4\" title=\"1856 \u0433\u043e\u0434\">1856<\/a>&#160;\u2014 \u0421\u043e\u043e\u0440\u0443\u0436\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D0%B2%D0%BE%D0%B7\" title=\"\u041f\u0430\u0440\u043e\u0432\u043e\u0437\">\u043f\u0430\u0440\u043e\u0432\u043e\u0437<\/a> \u00ab\u0422\u043e\u0440\u043e\u043d\u0442\u043e\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1874_%D0%B3%D0%BE%D0%B4\" title=\"1874 \u0433\u043e\u0434\">1874<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0432 \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u043a\u043e\u0439 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B4%D0%B0%D1%80\" title=\"\u041d\u0430\u0434\u0430\u0440\">\u041d\u0430\u0434\u0430\u0440\u0430<\/a> \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u043e\u0432-\u0438\u043c\u043f\u0440\u0435\u0441\u0441\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432: \u043d\u0435\u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0438\u0436\u0441\u043a\u0438\u0435 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B5,_%D0%9A%D0%BB%D0%BE%D0%B4\" title=\"\u041c\u043e\u043d\u0435, \u041a\u043b\u043e\u0434\">\u041c\u043e\u043d\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BD%D1%83%D0%B0%D1%80,_%D0%9F%D1%8C%D0%B5%D1%80_%D0%9E%D0%B3%D1%8E%D1%81%D1%82\" title=\"\u0420\u0435\u043d\u0443\u0430\u0440, \u041f\u044c\u0435\u0440 \u041e\u0433\u044e\u0441\u0442\">\u0420\u0435\u043d\u0443\u0430\u0440<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%81%D1%81%D0%B0%D1%80%D1%80%D0%BE,_%D0%9A%D0%B0%D0%BC%D0%B8%D0%BB%D1%8C\" title=\"\u041f\u0438\u0441\u0441\u0430\u0440\u0440\u043e, \u041a\u0430\u043c\u0438\u043b\u044c\">\u041f\u0438\u0441\u0441\u0430\u0440\u0440\u043e<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B7%D0%B0%D0%BD%D0%BD,_%D0%9F%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0437\u0430\u043d\u043d, \u041f\u043e\u043b\u044c\">\u0421\u0435\u0437\u0430\u043d\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%B3%D0%B0,_%D0%AD%D0%B4%D0%B3%D0%B0%D1%80\" title=\"\u0414\u0435\u0433\u0430, \u042d\u0434\u0433\u0430\u0440\">\u0414\u0435\u0433\u0430<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D1%8C%D0%B2%D0%B0%D1%80_%D0%9A%D0%B0%D0%BF%D1%83%D1%86%D0