a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430<\/a> \u0433\u0438\u0434\u0440\u043e\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9C%D0%94%D0%A0-4&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041c\u0414\u0420-4 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u041d\u0422-27<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 4 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%90%D0%93%D0%98\" title=\"\u0426\u0410\u0413\u0418\">\u0426\u0410\u0413\u0418<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u0432 \u0411\u0435\u043b\u043e\u043c \u0434\u043e\u043c\u0435 \u043f\u0440\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B7%D0%B2%D0%B5%D0%BB%D1%8C%D1%82,_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BB%D0%B8%D0%BD_%D0%94%D0%B5%D0%BB%D0%B0%D0%BD%D0%BE\" class=\"mw-redirect\" title=\"\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442, \u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d \u0414\u0435\